script: |
  super -f text -I q4293.spq | sort > q4293.out

inputs:
  - name: q4293.spq
    data: |
      SELECT 90 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - col0 - - ( 41 ) - col0 + col2 BETWEEN + - col1 * 19 + col2 AND ( col2 - col0 );
  - name: tab1

outputs:
  - name: q4293.out
    data: |
      90
